postcontent:
I recently bought this Jimenez J.22LR Chrome pocket pistol at the Colorado Spring gun show. However, it was an impulse buy and my wife wants me to sell it.

It is brand new in a box. I am asking $175, which is couple of dollars less than what I paid for it. I am sorry I cannot accept lower. 

Background checks are over 1 week if you were to buy from a dealer. Buying online requires background check and fee for conducting the check which can cost $30+ and requires over 1 week waiting. If you are looking for immediate possession, here you go.

All I ask is that you sign my bill of sale and $175 cash. We can meet at a public place for the transaction. It really is a beautiful little pistol. It is made by same manufacturer as the old Jennings or Bryco. The company was bought out by the company foreman, Jimenez, therefore that is the name now stamped on the pistol.

Included is:

Original Box;
(1) J22 Chrome;
(2) six shot .22 LR magazines;
(1) specially designed trigger safety made for J22 only;
(1) warranty and instruction manual;
*Original factory lifetime warranty for all Jimenez....Made in USA....Las Vegas, NV.

Please do not contact me with any unreasonable offers, because I would rather keep it and deal with my wife. I have to get $175.

Victor

REDACTED
**Just moved to CO., thats why I still have La. number.****
